import React, { Component } from 'react';


import { Navbar, NavItem, Icon } from 'react-materialize';
import SideMenu from './SideMenu';


class Nav extends Component {
    render () {
        return  <Navbar
        alignLinks="right"
        brand={<a className="brand-logo" href="#"> Book Me In</a>}
        menuIcon={<Icon>menu</Icon>}
        options={{
          draggable: true,
          edge: 'left',
          inDuration: 250,
          onCloseEnd: null,
          onCloseStart: null,
          onOpenEnd: null,
          onOpenStart: null,
          outDuration: 200,
          preventScrolling: true
        }}
      >

      </Navbar>
    }
}

export default Nav
